description:
Elvis Presley - Rubberneckin' (Paul Oakenfold Remix) [promo].VOB 



HQ promo music video. Recorded at American Sound Studio, &quot;Rubberneckin'&quot; 
would be used in the film &quot;Change of Habit&quot;, which was Presley's 31st and 
final movie acting role, and subsequently issued as the b-side of RCA single 
&quot;Don't Cry Daddy&quot;. This remix is from &quot;ELVIIS: 2nd to None&quot;, the follow-up 
album to Elvis Presley's 2002 album ELV1S: 30 #1 Hits. It is a collection of 
Elvis' songs which didn't make it to number-one (with the exception of 
&quot;I Want You, I Need You, I Love You&quot;). 
(video does not have any logos)


